import React from "react";
import PropTypes from "prop-types";
import Drawer from "@material-ui/core/Drawer";
import List from "@material-ui/core/List";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import Divider from "@material-ui/core/Divider";
import ListItem from "@material-ui/core/ListItem";
import ListItemText from "@material-ui/core/ListItemText";
import { NavLink, BrowserRouter } from "react-router-dom";
import Avatar from "@material-ui/core/Avatar";
import { fade, makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  sideMenu: {}
}));

function SideMenu(props) {
  const classes = useStyles();

  return (
    <Drawer anchor="right" open={props.open}>
      <div className={classes.sideMenu} role="presentation">
        <List>
          <ListItem component={NavLink} to="/user" button key="1">
            <ListItemAvatar>
              <Avatar
                alt="Remy Sharp"
                src="https://experience.sap.com/fiori-design-web/wp-content/uploads/sites/5/2017/02/Avatar-Sizes-Custom-1.png"
              />
            </ListItemAvatar>
            <ListItemText
              primary="Çağlayan Şerbetçi"
              secondary="caglayanserbetci@gmail.com"
            />
          </ListItem>
          <ListItem component={NavLink} to="/" button key="2">
            <ListItemText primary="Dersim" />
          </ListItem>
          <ListItem component={NavLink} to="/user/account" button key="2">
            <ListItemText primary="Hesabım" />
          </ListItem>
          <Divider />
          <ListItem component={NavLink} to="/help" button key="2">
            <ListItemText primary="Yardım" />
          </ListItem>
          <ListItem button key="1">
            <ListItemText primary="Çıkış" />
          </ListItem>
        </List>
      </div>
    </Drawer>
  );
}

SideMenu.propTypes = {};

export default SideMenu;
